import fileDefault from '../data/images/file-blank-solid-240.png';
import fileCSS from '../data/images/file-css-solid-240.png';
import filePdf from '../data/images/file-pdf-solid-240.png';
import filePng from '../data/images/file-png-solid-240.png';

const ImageConfig = {
  default: fileDefault,
  pdf: filePdf,
  png: filePng,
  css: fileCSS,
};

export default ImageConfig;
